import React, { useState, useEffect } from 'react';
import './App.css';
import { Button,TableRow,TableCell, TableHead, TableContainer } from '@mui/material';



import CssBaseline from '@mui/material/CssBaseline';

import Link from '@mui/material/Link';

import Box from '@mui/material/Box';

import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { createTheme, ThemeProvider } from '@mui/material/styles';
function Copyright(props) {
    return (
      <Typography variant="body2" color="text.secondary" align="center" {...props}>
        {'Copyright © '}
        <Link color="inherit" href="https://mui.com/">
          Your Website
        </Link>{' '}
        {new Date().getFullYear()}
        {'.'}
      </Typography>
    );
  }

  // TODO remove, this demo shouldn't need to reset the theme.

  const defaultTheme = createTheme();




var count =2;
function Case() {

   // console.log(id);
   var [data1, setData] = useState([]);
    const [data2, setData2] = useState([]);
    var admin;

    useEffect(() => {
        const id =  localStorage.getItem("id");
        const admin_id =  localStorage.getItem("id");
        async function getJSON() {

              const response = await fetch("http://localhost:3333/getinfoadmin/"+id, {
                method: "GET", // or 'PUT'


              });



              const data = await response.json();
              admin = data;
              setData(data);
              console.log(data);




          }
          getJSON();



          async function getJSON1() {

            const response = await fetch("http://localhost:3333/getinfocase/"+admin_id, {
              method: "GET", // or 'PUT'


            });



            const case_status = await response.json();



          //console.log(data3);
          setData2(case_status);

        }


        getJSON1();


      }, [])
     // console.log(data1);

     console.log('admin',data1);
     console.log(data2);
  return (


<ThemeProvider theme={defaultTheme}>
      <Container component="main" maxWidth="xl">

        <Box
          sx={{
            marginTop: 8,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
          }}
        >
            <Typography>{'ชื่อพนักงาน : '}{data1[0].fname}{' '}{data1[0].lname}</Typography>

                <TableHead>
                    <TableRow>
                        <TableCell>รหัสเคส</TableCell>
                        <TableCell>สถานะเคส</TableCell>
                        <TableCell>อื่นๆ</TableCell>
                    </TableRow>
                </TableHead>
        {data2.map((row) => (
                                  <TableRow
                                    hover
                                    tabIndex={-1}
                                    key={row.id}
                                  >
                                    <TableCell align="center">

                                    </TableCell>
                                    <TableCell>

                                    </TableCell>

                                  </TableRow>
                                ))}


        </Box>
        <Copyright sx={{ mt: 8, mb: 4 }} />
      </Container>
    </ThemeProvider>



  );
}

export default Case;
